	private boolean writeXML() {
		boolean ok = false;
		ConfigControl cc = null;
		File configFile = null;
		DocumentBuilderFactory docFactory = null;
		DocumentBuilder docBuilder = null;
		Document doc = null;
		Element rootElement = null;
		Element DBConfig = null;
		Element tmp = null;
		TransformerFactory transformerFactory = null;
		Transformer transformer = null;
		DOMSource source = null;
		StreamResult result = null;

		try {
			docFactory = DocumentBuilderFactory.newInstance();
			docBuilder = docFactory.newDocumentBuilder();

			doc = docBuilder.newDocument();
			rootElement = doc.createElement("DCISYS");
			doc.appendChild(rootElement);

			DBConfig = doc.createElement("DBConfig");
			rootElement.appendChild(DBConfig);

			tmp = doc.createElement("DBAddr");
			tmp.appendChild(doc.createTextNode("123412341"));
			DBConfig.appendChild(tmp);

			cc = new ConfigControl(false, "");
			configFile = new File(cc.getConfigXMLPath());

			if (!configFile.exists()) {
				configFile.mkdir();
			}
			configFile = new File(cc.getConfigXMLPath("test.xml"));

			transformerFactory = TransformerFactory.newInstance();
			transformer = transformerFactory.newTransformer();
			source = new DOMSource(doc);
			result = new StreamResult(configFile);

			transformer.transform(source, result);

			ok = true;

		} catch (Exception ex) {
			ok = false;
			ex.printStackTrace();
		}

		return ok;
	}

	public String getHardwareKey(String guardip, int port) {
		String code = "";
		Socket socket = null;
		DataOutputStream out = null;
		InputStreamReader in = null;

		try {
			socket = new Socket(guardip, port);
			socket.setSoTimeout(180000);
			out = new DataOutputStream(socket.getOutputStream());
			// 設定key值 ip+SFT+今天日期
			String key = getkey();
			out.writeUTF(key);
			String codetemp = "";
			// Socket回傳
			in = new InputStreamReader(socket.getInputStream());
			while (true) {
				int ch = in.read();
				codetemp += (char) ch;
				if (in.ready() == false)
					break;
			}
			in.close();
			socket.close();

			code = codetemp;// 傳出32碼

			if (code != null && code.length() < 30) {
				code = String.format("%-" + 30 + "s", code).replace(' ', '0');
			}
		} catch (Exception ex) {
			ex.printStackTrace();
			code = "";
		} finally {
			if (in != null) {
				try {
					in.close();
				} catch (Exception ex) {

				}
			}
			if (socket != null && !socket.isClosed()) {
				try {
					socket.close();
				} catch (Exception ex) {

				}
			}
		}
		return code;
	}

	private String XorFunction(String pkkey, String FData) {
		String returnd = "";
		char[] a = pkkey.toCharArray();
		char[] b = FData.toCharArray();
		for (int i = 0; i < b.length; i++) {
			for (int j = 0; j < a.length; j++) {
				b[i] = (char) (b[i] ^ a[j]);
			}
			returnd += (char) b[i];
		}
		return returnd;
	}

